style.css:
@-moz-document url-prefix("https://www.youtube.com/"), url-prefix("https://m.youtube.com/") {
.yt-icon.ytd-topbar-logo-renderer {
        font-family: 'Lexend Deca', sans-serif;
    }

    .yt-icon.ytd-topbar-logo-renderer span.yami {
        color: #FFD700;
        text-shadow: -1px -1px 0 #FF0000, 1px -1px 0 #FF0000, -1px 1px 0 #FF0000, 1px 1px 0 #FF0000;
    }

    .yt-icon.ytd-topbar-logo-renderer span.tube {
        font-family: 'Lexend Deca', sans-serif;
    }

    body {
        background-image: url(https://i.pinimg.com/564x/4e/ce/60/4ece6008b89af1a9e7395281bdf26c11.jpg);
        background-size: cover;
        background-position: center;
        background-repeat: no-repeat;
        color: #FFFFFF;
    }

    .youtube-taskbar {
        background-color: #FF0000;
        color: #FFFFFF;
        font-size: 16px;
        padding: 10px;
        display: flex;
        justify-content: space-between;
        align-items: center;
    }

    .youtube-taskbar img {
        max-width: 50px;
        margin-right: 10px;
        content: url(https://i.ytimg.com/vi/QQCQqk508e8/maxresdefault.jpg);
    }

    h1, h2 {
        font-family: 'Lexend Deca', sans-serif;
        color: #FFD700;
    }
}
